import React from "react";
import { component } from "react-redux";

class Gallery extends React.PureComponent {
    render() {
        return (
            <>
                <div className="gallery">
                    <img src="./images/example1.jpg" alt="some news here" class="news-item" />
                    <img src="./images/example2.jpg" alt="some news here" class="news-item" />
                    <img src="./images/example3.jpg" alt="some news here" class="news-item" />
                </div>
            </>
            )
    }
}
export default Gallery;
